import {Link} from 'react-router-dom';
import {useRef} from "react";

function Header(){
    const elNav = useRef();
    const elBuger = useRef();
    const kor = 'kor', eng = 'eng', jpa = 'jpa', chi = 'chi';

    function navigation(){
        elNav.current.classList.toggle('active');
        elBuger.current.classList.toggle('active');
    }
    return(
        <>
            <header>
                <div className='head mwidth'>
                    <Link to="/"><h1>궁궐</h1></Link>
                    <p className='bugermenu' ref={elBuger} onClick={navigation}>
                        <span></span>
                        <span></span>
                        <span></span>
                    </p>
                </div>
                <nav className='menu mwidth' ref={elNav}>
                    <ul>
                        <li><Link to="">경복궁</Link></li>
                        <li><Link to="">창경궁</Link></li>
                        <li><Link to="">창덕궁</Link></li>
                        <li><Link to="">덕수궁</Link></li>
                        <li><Link to="">종묘</Link></li>
                    </ul>
                    <ul>
                        <li>로그인</li>
                        <li>좋아요</li>
                        <li>검색</li>
                        <select name='lan'>
                            <option value={kor}>한국어</option>
                            <option value={eng}>영어</option>
                            <option value={jpa}>일본어</option>
                            <option value={chi}>중국어</option>
                        </select>
                    </ul>
                </nav>
            </header> 
        </>
    );
}
export default Header;
